import React, {useState, useEffect} from "react";
function App() {
    const [number, setNumber] = useState(getRandomNumber(100));
    return (
        <main>
            {
                number.map(data => {
                    return (
                        <div className="line" key={data}>

                        </div>
                    )
                })
            }
        </main>
    )
}
const getRandomNumber = (number) => {
    return Array.from({length: number}, () => Math.floor(Math.random() * number));
}
export default App;
